pragma solidity ^0.5.0;

contract Logging {
    string public name;
    uint public logCount = 0;
    mapping(uint => Log) public logs;

    struct Log {
        uint id;
        string username;
        uint timestamp;
    }

    event LogCreated( // ???
        uint id,
        string username,
        uint timestamp
    );

    constructor() public {
        name = "SsorinLogger";
    }

    function createLog(string memory _username, uint _timestamp) public {
        // valid username
        require(bytes(_username).length > 0);
        // increment log count
        logCount++;
        // create a log
        logs[logCount]
            = Log(logCount, _username, _timestamp);
        // trigger on event
        emit LogCreated(logCount, _username, _timestamp);
    }
}
